import { Col } from "react-bootstrap";

export const ProjectCard = ({ title, description, imgUrl }) => {
  return (
    <Col size={12} sm={6} md={4}>
      <div className="proj-imgbx">
        <img src={imgUrl} />
        <div className="proj-txtx">
          <h4>{title}</h4>
          <span>{description}</span>
        </div>
      </div>
    </Col>
  )
}
const projects = [
  { title: 'Project 1', description: 'This is project 1', imgUrl: '/project1.jpg' },
  { title: 'Project 2', description: 'This is project 2', imgUrl: '/project2.jpg' },
  { title: 'Project 3', description: 'This is project 3', imgUrl: '/project3.jpg' },
  { title: 'Project 4', description: 'This is project 4', imgUrl: '/project4.jpg' },
  { title: 'Project 5', description: 'This is project 5', imgUrl: '/project5.jpg' },
  { title: 'Project 6', description: 'This is project 6', imgUrl: '/project6.jpg' },
]

// ...

{projects.map((project, index) => (
  <ProjectCard key={index} title={project.title} description={project.description} imgUrl={project.imgUrl} />
))}
